import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import { MdCreateNewFolder } from 'react-icons/md';


function AddProject() {
  
    return (
      <div className="add-row">
          <div className="add-project-name">
            
            <button className="btn btn-success">צור פרוייקט  <span><MdCreateNewFolder/></span></button>
            <div className="inputs">
               <div className="project-info">
               <input  className="form-control" type="text"  placeholder="שם הפרוייקט"/>
               <input  className="form-control" type="text"  placeholder="תעריף שעתי"/>
               </div>
               .consumer
               <input  className="form-control" type="text"  placeholder="לקוח - מספר טלפון"/>
               <input  className="form-control" type="text"  placeholder="לקוח - כתובת מייל"/>
            </div>
              
              
            
          </div>
      </div>
    );
  }
  
  export default AddProject;
